import React from 'react';

const ImageChangeOnMouseOver = () => {
    return (
        <div>
            <img
                src="/static/speakers/bw/Speaker-187.jpg"
                alt="" />
            <img
                src="/static/speakers/bw/Speaker-1124.jpg"
                alt="" />
        </div>
    )
}

export default ImageChangeOnMouseOver;
